import React from "react";
import { useState } from "react";

export default function Register() {
  const [user, setUser] = useState({
    first_name: "",
    last_name: "",
    age: "",
    email: "",
    password: "",
  });

  let submitFormData = (e) => {
    e.preventDefault();
    alert("submit");
  };


  let getInputValue=(e)=>{
    let myUser = {...user};
    myUser.first_name=e.target.value;
    setUser(myUser);
    console.log(myUser.first_name);
  }

  return (
    <>
      <div className=" w-75 m-auto py-5">
        <h2>Registeration Form</h2>
        <form onSubmit={submitFormData}>
          <div className="input-data my-2">
            <label htmlFor="first_name">First Name</label>
            <input
              type="text"
              name="first_name"
              className="form-control my-2"
              onChange={getInputValue}
            />
          </div>
          <div className="input-data my-2">
            <label htmlFor="last_name">Last Name</label>
            <input type="text" name="last_name" className="form-control my-2" />
          </div>
          <div className="input-data my-2">
            <label htmlFor="age">Age</label>
            <input type="number" name="age" className="form-control my-2" />
          </div>
          <div className="input-data my-2">
            <label htmlFor="email">Email</label>
            <input type="email" name="email" className="form-control my-2" />
          </div>
          <div className="input-data my-2">
            <label htmlFor="Password">Password</label>
            <input
              type="Password"
              name="Password"
              className="form-control my-2"
            />
          </div>

          <button className="btn btn-info my-3 float-end">Register</button>
          <div className="clear-fix"></div>
        </form>
      </div>
    </>
  );
}
